import logo from './logo.svg';
import './App.css';
import { Fragment } from 'react';

function Smth1(props){
  return <p>{props.cos}</p>;

}

function Smth2(props){
  return <p>{props.children}</p>;

}

function App() {
  const h = <h2>asd</h2>
  return (
      <Fragment>
        <>
        </>
      <Smth1 cos={h}/>
      <Smth2>
        <h2></h2>
        <h2></h2>
        <h2></h2>
      </Smth2>
      </Fragment>
  );
}

export default App;
